import strings from "../strings.json";
import Button from "../components/Button";
import { useState, Fragment } from "react";
import { Container, Row, Col } from "react-grid-system";

export default () => {
    const [step, setStep] = useState(0);

    return <Fragment>
        {step === 0 && <Fragment>
            <Row>
                <Col sm={6}>
                    <input className="field not-round" placeholder={strings.english.Common.FullName} />
                </Col>
                <Col sm={6}>
                    <input className="field not-round" placeholder={strings.english.Common.IDNumber} />
                </Col>
            </Row>
            <div className="text-right mt-2">
                <Button>Add</Button>
            </div>
        </Fragment>}
        {step === 1 && <Fragment>

        </Fragment>}
    </Fragment>
}
